export async function checkUser(props) {
  console.log({ email: props.email, password: props.pasword });
  let login;
  login = 'https://pacific-fortress-54764.herokuapp.com/users/login'; //login send req url
  let response = await fetch(login, {
    method: 'POST',
    body: JSON.stringify({ email: props.email, password: props.pasword }),
    headers: {
      'Content-Type': 'application/json',
    },
  });
  let data = await response.json();
  console.log(data);
  if (!response.ok) {
    console.log('fuck');
    throw new Error(data.message || 'Authentication Failed');
  }
}

